import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import Navbar from './components/Navbar';
import Home from './pages/Home';
import Cart from './components/Cart';
import CustomPizza from './pages/CustomPizza';
import Checkout from './pages/Checkout';
import Login from './pages/Login';
import Register from './pages/Register';
import VerifyEmail from './pages/VerifyEmail';
import ForgotPassword from './pages/ForgotPassword';
import ResetPassword from './pages/ResetPassword';
import MyOrders from './pages/MyOrders';
import AdminDashboard from './pages/AdminDashboard';
import AdminRoute from './components/AdminRoute';

function App() {
  const [cart, setCart] = useState([]);
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Check local storage for user info on initial load
    const userInfo = localStorage.getItem('userInfo');
    if (userInfo) {
      try {
        setUser(JSON.parse(userInfo));
      } catch (error) {
        console.error('Failed to parse user info from local storage', error);
        localStorage.removeItem('userInfo');
      }
    }
  }, []);

  const addToCart = (pizzaToAdd) => {
    // A unique identifier for a cart item is its database ID plus its size
    const cartId = pizzaToAdd._id + '-' + pizzaToAdd.size;

    const existingPizza = cart.find((pizza) => pizza.cartId === cartId);

    if (existingPizza) {
      setCart(
        cart.map((pizza) =>
          pizza.cartId === cartId
            ? { ...pizza, quantity: pizza.quantity + 1 }
            : pizza
        )
      );
      toast.info(`Increased ${pizzaToAdd.name} quantity in cart!`);
    } else {
      // Add the new item with a cartId and initial quantity
      setCart([...cart, { ...pizzaToAdd, cartId: cartId, quantity: 1 }]);
      toast.success(`${pizzaToAdd.name} added to cart!`);
    }
  };

  const addCustomPizzaToCart = (customPizza) => {
    const newPizzaId = `custom-${Date.now()}`;
    const newPizza = {
      _id: newPizzaId, // Unique ID for client-side state
      cartId: newPizzaId, // Ensure a unique key for the cart
      name: `Custom Pizza (${customPizza.base}, ${customPizza.sauce})`,
      ...customPizza,
      price: 14.99, // Example base price for a custom pizza
      quantity: 1,
      isCustom: true, // Flag to identify custom pizzas in the cart
    };

    setCart([...cart, newPizza]);
    toast.success("Your custom pizza has been added to the cart!");
  };

  const logoutHandler = () => {
    localStorage.removeItem('userInfo');
    setUser(null);
    setCart([]); // Optional: clear cart on logout
    toast.info("You have been logged out.");
  };

  return (
    <Router>
      <ToastContainer
        position="top-right"
        autoClose={3000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
      />
      <Navbar user={user} logoutHandler={logoutHandler} />
      <main>
        <Routes>
          <Route path="/" element={<Home addToCart={addToCart} />} />
          <Route path="/cart" element={<Cart cart={cart} setCart={setCart} />} />
          <Route path="/checkout" element={<Checkout cart={cart} user={user} setCart={setCart} />} />
          <Route path="/custom" element={<CustomPizza addCustomPizzaToCart={addCustomPizzaToCart} />} />
          <Route path="/login" element={<Login setUser={setUser} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/verify" element={<VerifyEmail />} />
          <Route path="/forgot-password" element={<ForgotPassword />} />
          <Route path="/reset-password" element={<ResetPassword />} />
          <Route path="/my-orders" element={<MyOrders user={user} />} />

          {/* Admin Routes */}
          <Route path="/admin" element={<AdminRoute user={user} />}>
            <Route path="dashboard" element={<AdminDashboard user={user} />} />
            {/* You can add other admin routes like /admin/users here */}
          </Route>
        </Routes>
      </main>
    </Router>
  );
}

export default App;
